angular.module("mgcrea.ngStrap.datepicker").run(["$templateCache",function(a){"use strict";a.put("datepicker/datepicker.tpl.html",'<div class="dropdown-menu datepicker">\n<table tabindex="-1" height="100%">\n  <thead>\n    <tr class="text-center">\n      <th>\n        <button type="button" class="btn btn-default pull-left" ng-click="$selectPane(-1)">\n          <i class="glyphicon glyphicon-chevron-left"></i>\n        </button>\n      </th>\n      <th colspan="5" style="width: 100%;">\n        <button type="button" class="btn btn-default btn-block text-strong"  ng-click="$toggleMode()">\n          <strong style="text-transform: capitalize;" ng-bind="title"></strong>\n        </button>\n      </th>\n      <th>\n        <button type="button" class="btn btn-default pull-right" ng-click="$selectPane(+1)">\n          <i class="glyphicon glyphicon-chevron-right"></i>\n        </button>\n      </th>\n    </tr>\n    <tr ng-show2="labels" ng-bind-html="labels"></tr>\n  </thead>\n  <tbody>\n    <tr ng-repeat="(i, row) in rows">\n      <td colspan="7" style="letter-spacing: -4px;">\n        <span ng-repeat="(j, el) in row" class="text-center">\n          <button type="button" class="btn btn-default" style="height:{{height}}px;width:{{width}}%;" ng-class="{\'btn-primary\': el.selected}" ng-click="$select(el.date)" ng-disabled="el.disabled">\n            <span ng-class="{\'text-muted\': el.muted}" ng-bind="el.label"></span>\n          </button>\n        </span>\n      </td>\n    </tr>\n  </tbody>\n</table>\n</div>\n')}]),angular.module("mgcrea.ngStrap.select").run(["$templateCache",function(a){"use strict";a.put("select/select.tpl.html",'<ul tabindex="-1" class="select dropdown-menu" ng-show="$isVisible()" role="select">\n  <li role="presentation" ng-repeat="match in $matches" ng-class="{active: $isActive($index)}">\n    <a role="menuitem" tabindex="-1" ng-click="$select($index, $event)" ng-bind="match.label"></a>\n    <i class="glyphicon glyphicon-ok" ng-if="$isMultiple"></i>\n  </li>\n</ul>\n')}]);